                            "Vitamin A is a fat-soluble vitamin that is found in many plant and animal-based foods. The plant version is known as beta-carotene, while the animal version is known as retinol or retinyl palmitate. Vitamin A plays an important role in the health of your vision, immune system, and reproduction. Low levels of Vitamin A can thus be a significant risk factor in many health concerns.\n\nBCMO1\n\nBeta-carotene must be converted into retinol before the body can use it. An important gene in your DNA known as BCMO1 produces the enzyme that facilitates this reaction. Beta-carotene oxygenase 1 (BCMO1) is an enzyme that plays a key role in the conversion of vegetable-derived beta-carotene (the inactive version of Vitamin A) into retinol, the active form of vitamin A (usually derived from animal sources). Variations in the BCMO1 gene influence your body's ability to convert beta-carotene into retinol."
